import React from 'react';
// import { persons } from './persons'

const Card = (props) => {
	return (
		<div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			<h2>{props.name}</h2>
			<p>Age: {props.age}</p>
			<p>Gender: {props.gender}</p>
		</div>
	)
}

export default Card;
